const size_t dummy_audio_buffer_len = sizeof(dummy_audio_buffer);
uint32_t audio_idx = 0;

bool DummyAudioRemaining(void) {
  return (audio_idx<dummy_audio_buffer_len);
}

esp_err_t GetDummyAudioData(size_t requested_size, size_t* actual_size, int8_t* data) {
  // Set returned number of bytes to zero for now.
  *actual_size = 0;
  size_t remaining_bytes = 0;

  if((audio_idx+requested_size)>dummy_audio_buffer_len){
    // Copy till end of buffer
    memcpy(data, &dummy_audio_buffer[audio_idx], (dummy_audio_buffer_len-audio_idx));
    audio_idx = dummy_audio_buffer_len;
    *actual_size = (dummy_audio_buffer_len-audio_idx);
    ESP_LOGI("Dummy Audio", "Buffer end reached");
  } 
  else {
    memcpy(data, &dummy_audio_buffer[audio_idx], requested_size);
    audio_idx += requested_size;
    if (audio_idx == dummy_audio_buffer_len) {
        ESP_LOGI("Dummy Audio", "Buffer end reached");
    } 
    *actual_size = requested_size;
  }  
  return ESP_OK;

} 

// This is a different implementation where the audio buffer wraps around
esp_err_t GetDummyAudioData_wrap(size_t requested_size, size_t* actual_size, int8_t* data) {
  // Set returned number of bytes to zero for now.
  *actual_size = 0;
  size_t remaining_bytes = 0;

  if((audio_idx+requested_size)>dummy_audio_buffer_len){
    // Do wrap around
    memcpy(data, &dummy_audio_buffer[audio_idx], (dummy_audio_buffer_len-audio_idx));
    audio_idx = 0;
    *actual_size = (dummy_audio_buffer_len-audio_idx);
    // Here we assume that the requested size is not larger than the buffer length
    remaining_bytes = requested_size - (dummy_audio_buffer_len-audio_idx);
    memcpy(data, &dummy_audio_buffer[audio_idx], remaining_bytes);
    audio_idx = remaining_bytes;
    *actual_size = requested_size;
    ESP_LOGI("Dummy Audio", "Wrap Around");
  } 
  else {
    memcpy(data, &dummy_audio_buffer[audio_idx], requested_size);
    audio_idx += requested_size;
    if (audio_idx == dummy_audio_buffer_len) {
        audio_idx = 0;
        ESP_LOGI("Dummy Audio", "Wrap Around");
    } 
    *actual_size = requested_size;
  }  
  return ESP_OK;

} 
